var icons_app = new Vue({
    el: "#icon_app",
    data: {
        message: 'fksdljfljs',
        object_icons: [{
                src: "data:image/png;base64,",
                description: 'Бумажная',
                paper: true,
                penalty: false,
                count: 0,
            },
            {
                src: "data:image/png;base64,",
                description: 'Бумажная (свингер)',
                paper: true,
                penalty: false,
                count: 0,
            },
            {
                src: "data:image/png;base64,",
                description: 'Металл.(поппер)',
                paper: false,
                penalty: false,
                count: 0,
            },
            {
                src: "data:image/png;base64,",
                description: 'Металл. тарелка',
                paper: false,
                penalty: false,
                count: 0,
            },
            {
                src: "data:image/png;base64,",
                description: 'Штрафные цели',
                paper: false,
                penalty: true,
                count: 0,
            },

        ],
        sign_icons: [{
            src: "data:image/png;base64,",
            description: ''
        }, ],
        paper_target_need_shoots: "1",
        min_shoot_count: 0,
        max_score_stage: 0,
        bulet_mult: 1.5,
        bulet_add: 0,
        result_need_bulet: 0,
    },
    methods: {
        // Нахождение требуемого числа выстрелов
        min_shoot: function() {
            var result = 0
            for (var i = 0; i < this.object_icons.length; i++) {
                var target_shoot_count = this.object_icons[i].count
                if (this.object_icons[i].paper == true && this.paper_target_need_shoots == 2) {
                    target_shoot_count *= 2;
                }
                if (this.object_icons[i].penalty == true) {
                    target_shoot_count = 0;
                }
                console.log(target_shoot_count);
                result += target_shoot_count * 1
            }
            this.min_shoot_count = result;
            this.max_score()
        },
        max_score: function() {
            this.max_score_stage = this.min_shoot_count * 5
        },

        //Запись количества выстрелов в строевую записку
        setBulletsInStroytable: function() {
            stroy_table_app.setBulletsForAllShooters_outer(this.result_need_bulet);
        },

        //add new object icons
        addIconByType: function(type) {
            if (type == "objects") {
                this.object_icons.push({
                    src: "data:image/png;base64,",
                    description: ''
                })
            } else if (type == 'sign') {
                this.sign_icons.push({
                    src: "data:image/png;base64,",
                    description: ''
                })
            }
        },

        // delete object icons by id
        deleteIconByIdAndType: function(id, type) {
            console.log(id);
            console.log(type);
            // this.object_icons.splice(i, 1)
            if (type == "objects") {
                this.object_icons.splice(id, 1)

            } else if (type == 'sign') {
                this.sign_icons.splice(id, 1)
            }
        },

        // get file to icon
        getIconImageFile: function(id, type, event) {
            console.log(event);
            console.log(event.target.files);
            console.log(event.data);

            var file = event.target.files[0]
            var reader = new FileReader();

            if (type == "objects") {
                var img = this.object_icons[id]

            } else if (type == 'sign') {
                var img = this.sign_icons[id]
            }
            reader.onload = (function(aImg) {
                return function(e) {
                    aImg.src = e.target.result;
                };
            })(img);
            reader.readAsDataURL(file);

        },

        // get icons and descriptions for PDF
        getIconsAndDesForPDF: function() {
            var object_icons = this.object_icons;
            var sign_icons = this.sign_icons;
            var body = [];
            body.push([{ text: 'Мишени', colSpan: 2 }, {}]);

            // objects
            for (var i = 0; i < object_icons.length; i++) {
                var row = [{
                        image: object_icons[i].src,
                        width: 20,
                        height: 20
                    },
                    { text: object_icons[i].description + " " + object_icons[i].count + "шт" },
                    // { text: " " + object_icons[i].count + ' ' },
                ];
                console.log(object_icons[i].count);
                body.push(row)
            }
            body.push([{ text: 'Обозначения', colSpan: 2 }, {}]);

            // signs
            for (var j = 0; j < sign_icons.length; j++) {
                var row = [{
                    image: sign_icons[j].src,
                    width: 20,
                    height: 20
                }, { text: sign_icons[j].description }];
                body.push(row)
                console.log('sign_icons' + sign_icons[j].description);
            }

            // to pdf
            return body;
        }
    },
})

