var numId = 0

// Отключение действий по умолчанию на поверхности для иконок
function allowDrop(ev) {
    ev.preventDefault();
}

// Движение иконок
function drag(ev) {
    console.log('DRAG');
    ev.dataTransfer.setData("text", ev.target.id);
}

var touchDragItem, touchInMap

function sensorDragTest(e) {
    var map_location = document.getElementById("map").getBoundingClientRect();
    var bucket_location = document.getElementById("delete_icon").getBoundingClientRect();


    if ((e.touches[0].pageX > map_location.left && e.touches[0].pageX < map_location.right &&
            e.touches[0].pageY > map_location.top && e.touches[0].pageY < map_location.bottom)) {
        // console.log("in map");
        touchInMap = true
        if (touchDragItem != e.touches[0].target) {
            touchDragItem = e.touches[0].target;
            // console.log(touchDragItem);
        }
    } else {
        touchInMap = false
    }
}



// Вфставление иконок на карту и перемещение иконок на карте
function dropCopy(ev) {
    if (ev.type == "touchend") {
        // console.log("drop copy: " + touchDragItem.id);
        if (touchInMap == true) {
            var data = touchDragItem.id;
            touchInMap = false
        } else {
            // console.log("out of map");
            return;
        }
    } else {
        ev.preventDefault();
        var data = ev.dataTransfer.getData("text");
    }
    var icon_place = document.getElementById('icon_place');
    // console.log(document.getElementById(data));
    if (document.getElementById(data).classList.contains("inMap")) {
        var child = icon_place.appendChild(document.getElementById(data));
        setImageToChange(child.id)
    } else {
        var nodeCopy = document.getElementById(data).cloneNode(true);
        nodeCopy.id = "inMap_" + numId;
        var child = icon_place.appendChild(nodeCopy);
        // var child = ev.target.appendChild(nodeCopy);
        child.classList.remove("save_image");
        child.classList.add("inMap");
        // ontouchend="setImageToChange(' + "'" + newIdImage + "'" + ')"'
        child.setAttribute('ontouchstart', 'setImageToChange("inMap_' + numId + '")');
        child.setAttribute('onclick', 'setImageToChange("inMap_' + numId + '")');
        setImageToChange('inMap_' + numId)
        child.style.width = '48px'
        child.style.height = '48px'
        numId++;
    }

    child.style.position = 'absolute';
    child.style.zIndex = 100;
    var map_location = document.getElementById("map").getBoundingClientRect();
    if (ev.type == "touchend") {
        var x = ev.changedTouches[0].pageX - map_location.left - child.clientWidth / 2
        x < 0 ? x = 0 : x = x;
        x > map_location.right ? x = map_location.right - child.clientWidth - 5 : x = x;

        var y = ev.changedTouches[0].pageY - map_location.top - child.clientHeight / 2
        y < 0 ? y = 0 : y = y;
        y > map_location.bottom ? y = map_location.bottom - child.clientHeight - 5 : y = y;

        // console.log("x: " + x + " y: " + y)
        child.style.left = x + 'px';
        child.style.top = y + 'px';
    } else {
        child.style.left = ev.pageX - map_location.left - child.clientWidth / 2 + 'px';
        child.style.top = ev.pageY - map_location.top - child.clientHeight / 2 + 'px';
        // console.log("x: " + child.style.left + " y: " + child.style.top)
    }
}

function dropDelete(ev) {
    // get drop data
    if (ev.type == "touchend") {
        // console.log("drop copy: " + touchDragItem.id);
        if (touchInMap == true) {
            var data = touchDragItem.id;
            touchInMap = false
        } else {
            // console.log("out of map");
            return;
        }
    } else {
        ev.preventDefault();
        var data = ev.dataTransfer.getData("text");
    }
    console.log(data);

    // delete icon in map
    img = document.getElementById(data)
    console.log(img.classList);
    console.log(img.classList.contains('inMap'));
    if (img.classList.contains('inMap')) {
        setImageToChange(data)
        deleteImage()
    }
}
