var editing_image;
// Поворот иконок
function rotateImage() {
    var rotateInput = document.getElementById("rotateImage")
    $("#" + editing_image).css('transform', 'rotate(' + rotateInput.value + 'deg)');

    var img = document.getElementById(editing_image)
    img.setAttribute('data-transform-rotate', rotateInput.value)
}


// Изменение размера
function scaleImage() {
    var scaleImage = document.getElementById("scaleImage")
    image = document.getElementById(editing_image)
    $("#" + editing_image).css('width', scaleImage.value + 'px')
    $("#" + editing_image).css('height', scaleImage.value + 'px')
}

// Удаление иконки
function deleteImage() {
    if (editing_image) {
        document.getElementById(editing_image).remove()
        setInActiveIcon()
    }
}

function setInActiveIcon() {

    editing_image = ""
    document.getElementById("delete_image").setAttribute('disabled', "disabled")
    document.getElementById("rotateImage").setAttribute('disabled', "disabled")
    document.getElementById("scaleImage").setAttribute('disabled', "disabled")
}

// выбор изображения для изменения
function setImageToChange(image_id) {
    if (editing_image != image_id) {
        if (editing_image) {
            var previous_img = document.getElementById(editing_image)
            previous_img.classList.remove("selected");
        }
        editing_image = image_id

        // set icon selected
        var image = document.getElementById(image_id)

        var rotateInput = document.getElementById("rotateImage");
        rotateInput.removeAttribute('disabled');
        rotateInput.value = image.getAttribute('data-transform-rotate')

        var scaleInput = document.getElementById("scaleImage");
        scaleInput.removeAttribute('disabled');
        scaleInput.value = image.width

        var delete_image = document.getElementById('delete_image')
        delete_image.removeAttribute("disabled")

        // сделать изображение выбранным визуально
        image.classList.add("selected");
    }
}


