            // console.log(this.bullets);
            for (var i = 0; i < this.stroy_table.length; i++) {
                for (var j = 0; j < this.stroy_table[i].shooters.length; j++) {
                    this.stroy_table[i].shooters[j].bullets = this.bullets;
                };
            };
